import axios from 'axios';

const GREETING_REST_API_URL = 'http://localhost:8080/api/validate';

class GreetingService{
  getGreeting(ibans){
      return axios.get(GREETING_REST_API_URL + '?ibans=' + ibans);
  }
}

export default new GreetingService();
